import './App.css';
import FooterComponent from './components/FooterComponent';
import HeaderComponent from './components/HeaderComponent';
import StudentListComponent from './components/StudentListComponent';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import CreateStudentComponent from './components/CreateStudentComponent';
import CreateGroupComponent from './components/CreateGroupComponent';

function App() {
  return (
    <div>
        <Router>
          <HeaderComponent/>
          <div className="container">
            <Switch>
              <Route path = "/" exact component={StudentListComponent}></Route>
              <Route path = "/students" component={StudentListComponent}></Route>
              <Route path = "/add-student/:id" component={CreateStudentComponent}></Route>
              <Route path = "/add-group/:id" component={CreateGroupComponent}></Route>
            </Switch>
          </div>
        </Router>
    </div>
  );
}

export default App;
